(29983, 14055, 2973, 1, '龍之吻', '龍之吻 kiss of dragon 03:14  \r\n曲:張文光 編曲:張文光\r\n\r\n因為本身很喜歡三國時代的歷史故事\r\n歌一開始就先用大鼓節奏引述戰場故事\r\n描述關公騎著赤兔馬在戰場上，\r\n策馬衝鋒英勇的情境，為蜀國奮戰不懈的精神.\r\n曲中drum solo時\r\n還特別用(鑼鼓點)和(爵士鼓)對話,\r\n引述戰雲密佈,刀光劍影情景!\r\n\r\n二胡:呂明紘  DRUMS:張文光   MIDI Progamming:張文光\r\n', '2010-12-01 00:00:00', 2000, 20, 0, 15, '', '', 193, '', '張文光', '', '張文光', '我董娛樂經紀有限公司 iSEED Entertainment Co., Ltd.', '', 1, 1, 0, '2010-12-01 00:58:36', '2015-03-12 13:44:42', '0000-00-00 00:00:00'),
