(29985, 14055, 2973, 2, '北京城外', '北京城外 out of beijing city  03:58 \r\n曲:張文光 編曲:張文光\r\n\r\n描述清代時期，京城內外，\r\n許多百姓流落荒野的痛苦，\r\n主歌特別用二胡來詮釋惆悵失落感\r\n和後段drums和bass的對話。\r\n\r\n二胡:呂明紘    BASS:林金池     DRUMS & Percussion:張文光    MIDI Progamming:張文光\r\n', '2010-12-01 00:00:00', 2000, 20, 0, 15, '', '', 241, '', '張文光', '', '張文光', '我董娛樂經紀有限公司 iSEED Entertainment Co., Ltd.', '', 1, 1, 0, '2010-12-01 01:01:51', '2015-03-12 13:44:42', '0000-00-00 00:00:00'),
(29986, 1, 2959, 1, 'Dear John', '', '2010-12-03 00:00:00', 2000, 20, 0, 7, 'Be like\r\nBe like you\r\nWhen you give me all the light\r\n是否能讓我\r\nBe like\r\nBe like you\r\nWhen you give me all the light\r\n\r\n歲月的哨音正催促我\r\n尋找遺忘的感動\r\n年少輕狂之間\r\n電子情人之外\r\n在我塵封的回憶中\r\n你所說的話卻依然動容\r\n美麗男孩的臉\r\n編織和平與愛的夢\r\n請讓我\r\n\r\nBe like\r\nBe like you\r\nWhen you give me all the light\r\n是否能讓我\r\nBe like\r\nBe like you\r\nWhen you give me all the light\r\n\r\n耳提面命著我的風\r\n透露時光的線索\r\n青春無敵之間\r\n藍調鄉愁之外\r\n而一切歸於平淡之後\r\n那絢爛的夜卻依然不朽\r\n戰爭尚未停歇\r\n勞動英雄的愛依舊\r\n請讓我\r\n\r\nBe like\r\nBe like you\r\nWhen you give me all the light\r\n是否能讓我\r\nBe like\r\nBe like you\r\nWhen you give me all the light\r\n\r\nOh brothers\r\nCome ladies\r\n用你所有已沉睡的狂想\r\n看見自己在新世界的光\r\n讓我再一次對你說\r\n請讓我', '', 269, '', '', '', '徐千秀', '', 'TWQ131000001', 1, 1, 0, '2010-12-01 01:02:02', '2015-03-12 13:44:42', '0000-00-00 00:00:00'),
(29987, 14055, 2973, 3, '09：10', '09:10    04:15  \r\n曲:張文光 編曲:張文光\r\n\r\n當下寫好這首歌時，還沒點子命名，\r\n一看電腦時間,剛好是早上9點10分\r\n就將此曲命為09:10 \r\n09年時，和好友(黃子佼)無論是在電視節目演出\r\n或海外做秀合作演出時就很想寫歌邀請(黃子佼)唱，這首09:10想送給好友佼佼啦!\r\n借此機會也敬邀佼佼填詞,唱吧!希望(佼哥)會喜歡!!\r\n\r\nPIANO:張武興GUITAR:陳泰樑BASS:林金DRUMS:張文光\r\n', '2010-12-01 00:00:00', 2000, 20, 0, 15, '', '', 254, '', '張文光', '', '張文光', '我董娛樂經紀有限公司 iSEED Entertainment Co., Ltd.', '', 1, 1, 0, '2010-12-01 01:05:18', '2015-03-12 13:44:42', '0000-00-00 00:00:00'),
(29988, 14055, 2973, 4, '高山青', '高山青 green high mountain  04:09  \r\n曲:張文光 編曲:張文光\r\n\r\n台灣最具代表性歌曲，莫過於高山青此曲，\r\n世界各地的人，也都可朗朗上口此旋律，\r\n阿里山的日出，景色優美，有感而發，\r\n台灣音樂旋律和西方jazz融合一體，\r\n加以結合改編，讓高山青更有jazz Fu 啦!\r\n\r\nPIANO:張武興      BASS:林金池     DRUMS:張文光\r\n', '2010-12-01 00:00:00', 2000, 20, 0, 15, '', '', 251, '', '張文光', '', '張文光', '我董娛樂經紀有限公司 iSEED Entertainment Co., Ltd.', '', 1, 1, 0, '2010-12-01 01:08:43', '2015-03-12 13:44:42', '0000-00-00 00:00:00'),
(29989, 14055, 2973, 5, '等她', '等她 waiting for her ! 04:49   \r\n曲:張文光 編曲:張文光\r\n\r\n此曲旋律很簡易,\r\n編寫時應用了節拍讓此曲更有跳動感，\r\n也就是用大小鼓的節奏來命名,\r\n聽了就知道!!!\r\n等她,等她+等她.\r\n我是不是很白濫啊..... \r\n\r\nPIANO:張武興GUITAR:陳泰樑BASS:林金池\r\nDRUMS:張文光\r\n', '2010-12-01 00:00:00', 2000, 20, 0, 15, '', '', 291, '', '張文光', '', '張文光', '我董娛樂經紀有限公司 iSEED Entertainment Co., Ltd.', '', 1, 1, 0, '2010-12-01 01:12:40', '2015-03-12 13:44:42', '0000-00-00 00:00:00'),
(29990, 14055, 2973, 6, 'Drums and Bass', 'Drums and Guitar  00:56\r\n曲:張文光 編曲:張文光\r\n\r\n沒想到Drums和Guitar分軌\r\n也別有一番風格!!\r\n\r\nDRUMS:張文光\r\n', '2010-12-01 00:00:00', 2000, 20, 0, 15, '', '', 57, '', '張文光', '', '張文光', '我董娛樂經紀有限公司 iSEED Entertainment Co., Ltd.', '', 1, 1, 0, '2010-12-01 01:13:27', '2015-03-12 13:44:42', '0000-00-00 00:00:00'),
