(30002, 87852, 0, 1, '北海天堂夢', '', '2010-12-01 00:00:00', 2000, 0, 1, 7, '我將圍繞圍繞著你的氣息 直到沒有沒有了氧氣\r\n我滿載著水草水草的青 想要通通放進你手中瓶\r\n你將圍繞圍繞著我的氣息 直到沒有沒有了氧氣\r\n你滿載著天空天空的藍 想要通通抹在船上的帆\r\n\r\ni don''t wanna miss all your smile\r\ni wish it would be a beautiful moment\r\ni couldn''t make my self livin'' without you\r\nand we convinced that our dreams will come true\r\n\r\n北海悠悠悠悠珊瑚情 然然於我心 天堂有有有有一襲夢 夢裡有我和你\r\n我們慵慵慵慵懶懶躺 輕鬆的徜徉 徜徉無邊無際的美麗  \r\n\r\n噢寶貝我們可以用手印將夢想畫在明信片上\r\n讓他乘著風浪帶著幸福一直到世界的盡頭\r\n嘿寶貝我們可以用腳印將足跡填滿這沙灘上\r\n這裡沒有紛擾只有歡樂勾勒出天堂的輪廓\r\n\r\n\r\n\r\n一片朦朧一片朦朧  \r\n像是藏在霧氣裡頭 \r\n霧氣裡頭霧氣裡頭 \r\n冉冉升起 熱氣球', '', 327, '', 'V', 'V', 'V', '', '', 0, 0, 1, '2010-12-01 13:02:04', '2013-10-07 17:17:29', '0000-00-00 00:00:00'),
(30003, 87858, 2976, 1, '練習曲', '', '2010-12-01 00:00:00', 2010, 20, 0, 7, '皺眉的天空放晴\r\n樹蔭透露著一絲清新的氣息\r\n那麼不經意將我喚醒 \r\n來不及告別過去\r\n未來已迫不及待拉著我前進\r\n寫下一篇新的旋律\r\n\r\n\r\n我不停反覆練習\r\n調整頑固的思緒\r\n也許有一點點焦急\r\n也許有點不合邏輯我不在意\r\n我不停反覆練習\r\n調整混亂的呼吸\r\n拋下頑固的自溺\r\n邁開我堅定不遲疑的腳印\r\n\r\n\r\n我不停練習\r\n頑固的思緒\r\n我不停練習\r\n頑固的自溺', '', 178, '', 'kiki', 'kiki', '法式綺思', 'goodie music', '', 1, 1, 0, '2010-12-01 17:12:30', '2015-03-12 13:44:43', '0000-00-00 00:00:00'),
(30004, 87858, 2976, 2, 'Dear..', '', '2010-12-01 00:00:00', 2010, 20, 0, 7, 'dear , why you need fresh air?\r\ndear,can you hold your breath ？\r\n為何沈默不語\r\n總是在迷霧裡\r\n緊緊抓住又放逐邊際\r\n\r\n風雨前的寧靜\r\n總是令人窒息\r\n你倉皇的眼睛\r\n透露著你的不安定\r\n就像黑夜的流星\r\n碰撞後轉眼又逝去\r\n帶走了我的氧氣\r\n沈睡大海裡', '', 194, '', 'kiki', 'kiki', '法式綺思', 'goodie music', '', 1, 1, 0, '2010-12-01 17:32:51', '2015-03-12 13:44:43', '0000-00-00 00:00:00'),
(30005, 87858, 2976, 3, 'starry night', '', '2010-12-01 00:00:00', 2010, 20, 0, 7, '星星的閃耀   是我對你的微笑\r\n連成了一線   是我的晚禱\r\n天邊的雲朵    輕輕撫平我的傷痛\r\n只剩下           你曾經訴說的美好\r\nlike a  star       純潔無暇\r\nlike a  star        綻放光芒\r\nlike a  star        雖然距離很遠\r\nlike  a  star       不能遺忘的童話\r\n                        (沒有)遺忘的童話\r\n', '', 337, '', 'kiki', 'kiki', '法式綺思', 'goodie music', '', 1, 1, 0, '2010-12-01 17:41:04', '2015-03-12 13:44:43', '0000-00-00 00:00:00'),
(30006, 87858, 2976, 4, 'Restart', '', '2010-12-01 00:00:00', 2010, 20, 0, 7, '迎著風 夕陽下 晃動著腳指頭\r\n我的心  拍打著狂亂的節奏\r\n空氣裡 記憶中 瀰漫著懷舊的氣味正濃\r\n \r\n傾洩而下的想念泛流\r\n \r\n飄揚的  長頭髮  連結著世界兩端的你我\r\n \r\n這瞬間  我們有一樣的脈動\r\n \r\n穿越山 穿越海 穿越過世界的盡頭\r\n放手飛 勇敢讓心自由\r\n \r\nShowdow of my life\r\nyou will be free tonight\r\nyou know you will leave your life\r\nwindblows and free my mind\r\ni will not lookback\r\ni know i will be free start tonight', '', 250, '', 'kiki', 'kiki', '法式綺思', 'goodie music', '', 1, 1, 0, '2010-12-01 17:48:17', '2015-03-12 13:44:43', '0000-00-00 00:00:00'),
